import React from 'react';
import { Box, IconButton } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import PersonIcon from '@mui/icons-material/Person';

const Navbar = () => {
  const navigate = useNavigate();

  return (
    <Box 
      sx={{
        position: 'absolute',
        bottom: 0,
        left: 0,
        right: 0,
        bgcolor: 'white', // Color de fondo
        boxShadow: 2,
        display: 'flex',
        justifyContent: 'space-around', // Cambia justifyContent a space-around
        alignItems: 'center', // Alinea los íconos verticalmente
        padding: '8px 0', // Cambia el padding para que sea uniforme
        zIndex: 2000,
      }}
    >
      <IconButton 
        onClick={() => navigate('/profile')} 
        aria-label="Profile"
      >
        <PersonIcon fontSize="large" />
      </IconButton>
      {/* Puedes añadir más botones aquí si lo deseas */}
    </Box>
  );
};

export default Navbar;
